import { StatusBar } from 'expo-status-bar';
import React,{Component} from 'react';
import { StyleSheet, Text, View, Image, Button, TouchableOpacity, TextInput} from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Image style={styles.logo} source={require("./assets/logokien-signup.8641c4b2.png")}/>
        <Text style={styles.title}>Devzone</Text>
      </View>
      <TextInput onChangeText={text => onChangeText(text)} value="" placeholder="Insert Username"/>
      <TextInput onChangeText={text => onChangeText(text)} value="" placeholder="Insert Password"/>
      <Button title="Login"></Button>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    justifyContent: 'center',
    backgroundColor:"#1fcecb"
  },
  header:{
    flex:1,
    flexDirection:"row",
    justifyContent:"center",
    top:"90px",
    bottom:0
  },
  logo:{
    width:"50px",
    height:"50px"
  },
  title:{
    marginLeft:5,
    fontSize:35,
    fontWeight:"bold"
  },
  input:{
    marginTop:0
  }
});
